export function Droppable(props) {
  const { isOver, setNodeRef } = useDroppable({ id: "droppable" });

  return (
    <div
      ref={setNodeRef}
      className={`
        relative          // <--- THIS IS IMPORTANT
        w-[400px]
        h-[400px]
        border-4
        border-dashed
        border-gray-500
        rounded-xl
        bg-gray-100
        mt-8
      `}
    >
      {props.children}
    </div>
  );
}
